package org.example.string;

import org.junit.Test;

import java.io.UnsupportedEncodingException;

/**
 * Created by Zong on 2016/11/25.
 */
public class StringLength {
    public static void main(String[] args) throws UnsupportedEncodingException {
        System.out.println("============中文============");
        String s = "宗";
        System.out.println(s.length());// 1
        System.out.println("Unicode：" + s.getBytes("Unicode").length); // 4
        System.out.println("UTF-8：" + s.getBytes("UTF-8").length); // 3
        System.out.println("GBK：" + s.getBytes("GBK").length); // 2
        System.out.println("GB2312：" + s.getBytes("GB2312").length); // 2
        System.out.println("默认编码：" + s.getBytes().length); // 3
        System.out.println("============英文============");
        s = "a";
        System.out.println(s.length()); // 1
        System.out.println("Unicode：" + s.getBytes("Unicode").length); // 4
        System.out.println("UTF-8：" + s.getBytes("UTF-8").length); // 1
        System.out.println("GBK：" + s.getBytes("GBK").length); // 1
        System.out.println("GB2312：" + s.getBytes("GB2312").length); // 1
        System.out.println("默认编码：" + s.getBytes().length); // 1
    }

    @Test
    public void tooLong() {
//        String s = new String("");
//        System.out.println(s);
        StringBuffer sb = new StringBuffer();
        sb.append("")
                .append("");
        System.out.println(sb.toString());

        String s1 = "";
        String s2 = "";
        String s = s1 + s2;
        String ss = s.intern();
        System.out.println(ss.intern());
    }
}
